import "../janela/janela.css";
import Meio from "../../meio/meio";

function Janela({ dados }) {
  return (
    <div className="janela">
      {/* Exibe os dados carregados, se disponíveis */}
      {dados ? (
        <div className="clientes">
          <h2>Clientes</h2>
          <pre>{JSON.stringify(dados, null, 2)}</pre>{" "}
          {/* Exibe o JSON formatado */}
        </div>
      ) : (
        <p>Clique no botão para carregar os clientes.</p>
      )}
      <Meio dados={dados} />;
    </div>
  );
}

export default Janela;
